import React from 'react';
import { Link } from 'react-router-dom';
import { withAuth } from "../with_auth/with_auth";
import logo from '.. /logo.png';

const headerStyle: React.CSSProperties = {
    backgroundColor: "pink",
    height: "100px"
};

interface TopNavBarInternalProps {
    token: string | null;
}

interface TopNavBarInternalState {}

class TopNavBarInternal extends React.Component<TopNavBarInternalProps, TopNavBarInternalState> {
    public render() {
        return (
            <div style = { headerStyle}>
                <a href="/"><img src={logo} className="img" alt="logo" height="40px"></img></a>
                <Link className="links" to="/">Home</Link>
                {this._renderSomethingPrivate()}
            </div>
        );
    }

    private _renderSomethingPrivate() {
        const token = this.props.token;
        if (token) {
            return <Link style = {{ color: "#ffffff" }} to="/profile">
            <img
                src = "data:image/jpeg;base64,"
                style = {{ width: "30px"}}
            />
            </Link>;
        } else {
            return <Link style = {{ color: "#ffffff" }} to = "/login">Login</Link>
            return <Link style = {{ color: "#ffffff" }} to = "/login">Register</Link>
        }
    }
}

// withAuth will trigger a re-render
export const TopNavBar = withAuth(props => <TopNavBarInternal token = {props.authToken} />);
